import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function SimpleCalc(){

    return(
        <View style={styles.body}>
            <Text style={styles.h1}>Simple Calculator</Text>
        </View>
      );
};

const styles = StyleSheet.create({
    body:{
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        height: 'auto',
        marginTop: 10,
    },
    h1:{
        fontWeight:"bold",
        fontSize: 18,
    },
});
